LocaleInfo.ui_metadata_command_config_CompositeCommandConfigEditDialog_executeRuleScriptHint = "In GroovyScript, set processing rules when using compound command.<br>In the rule, it is possible to control the order of invocation of multiple commands, and finally implement it so as to return the execution result string of Command.<br>An instance of Command is bound to an cmd of a variable in advance as an array.<br>Also, RequestContext is bound to the variable request. <br>Setting Example:<pre>if (cmd[0].execute(request) == \"SUCCESS\") {\r\n    return cmd[1].execute(request);\r\n} else {\r\n    return cmd[2].execute(request);\r\n}\r\n</pre>If the rule is not specified, execute Command in the order specified in the list, The execution result of the last Command is returned as the execution result of Command.";
