LocaleInfo.generic_common_JavascriptAutocompletionSetting_javascriptDisplaNameKey = "Javascript";
LocaleInfo.generic_common_JavascriptAutocompletionSetting_javascriptDescriptionKey = "Set auto-completion Javascript to be executed when the linkage source property is changed.<br>The value of the linkage source property is javascript variable in the following format.<br><pre>var sourceVales = {\r\n  Property name 1: Property value,\r\n  Property name 2: [property value, ...], * when multiplicity is 2 or more \r\n}</pre>";
LocaleInfo.generic_common_WebApiAutocompletionSetting_autocompletionTypeDisplaNameKey = "Autocompletion type";
LocaleInfo.generic_common_WebApiAutocompletionSetting_autocompletionTypeDescriptionKey = "Specify how to obtain the value to be autocompleted.<br>EQL: Executes the set EQL and auto-complements with the result.<br>GROOVYSCRIPT: Automatically complements Groovyscript execution results.";
LocaleInfo.generic_common_WebApiAutocompletionSetting_eqlDisplaNameKey = "EQL";
LocaleInfo.generic_common_WebApiAutocompletionSetting_eqlDescriptionKey = "This is the process to be executed when EQL is selected with auto completion type.<br>Please write in GroovyTemplate format.<br><br>If the target item is Reference type, return the array of Entity.<br>Be sure to specify oid and name for EQL. If 「Property used as display label」 is specified, specify that property instead of name. If 「Unique Key Property」 is specified, specify that property.<br><br>In cases other than Reference type, the first Select item is used as the completion value.<br><br>Available variables are bound with the following names.<br><br>user\t: UserBinding ... user information<br>params\t: Map<String, String[]> ... The value of the property of the linkage source<br>currentValue\t: String, List<String> ... The value of the property of the linkage target(If there is more than one multiplicity, a list contains values of the property of the linkage target.)<br>params and currentValue is escaped for EQL. When using it in a LIKE statement, it is necessary to explicitly escape it for the Like statement.<br><br>The types that can be auto-complemented and the types of return values are as follows.<br>Binary type\t: String(search condition only)<br>Boolean type\t: boolean, String(true/false)<br>Date type\t: Date, String(yyyyMMdd)<br>Datetime type\t: Timestamp, String(yyyyMMddhhmmssSSS)<br>Decimal type\t: Bigdecimal, String<br>Float type\t: Double, String<br>Integer type\t: Long, String<br>LongText type\t: String<br>Reference type\t: Entity(oid, name is required)<br>Select type\t: SelectValue, String(value)<br>String type\t: String<br>Time type\t: Time, String(hhmmssSSS)";
LocaleInfo.generic_common_WebApiAutocompletionSetting_groovyscriptDisplaNameKey = "Groovyscript";
LocaleInfo.generic_common_WebApiAutocompletionSetting_groovyscriptDescriptionKey = "This is a process to be executed when GROOVYSCRIPT is selected with autocomplete type.<br>Please write in GroovyScript format.<br><br>Available variables are bound with the following names.<br><br>user\t: UserBinding ... user information<br>params\t: Map<String, String[]> ... The value of the property of the linkage source<br>currentValue\t: String, List<String> ... The value of the property of the linkage target(If there is more than one multiplicity, a list contains values of the property of the linkage target.)<br><br>The types that can be auto-complemented and the types of return values are as follows.<br>If multiplicity is 2 or more or range search is possible, multiple values can be set by returning values in array.<br>Binary type\t: String(search condition only)<br>Boolean type\t: boolean, String(true/false)<br>Date type\t: Date, String(yyyyMMdd)<br>Datetime type\t: Timestamp, String(yyyyMMddhhmmssSSS)<br>Decimal type\t: Bigdecimal, String<br>Float type\t: Double, String<br>Integer type\t: Long, String<br>LongText type\t: String<br>Reference type\t: Entity(oid, name is required)<br>Select type\t: SelectValue, String(value)<br>String type\t: String<br>Time type\t: Time, String(hhmmssSSS)";
LocaleInfo.generic_editor_PropertyEditor_customStyleDisplayNameKey = "Display Custom Style";
LocaleInfo.generic_editor_PropertyEditor_customStyleDescriptionKey = "I will specify the style for the input element of the search screen of condition parts and the output element of the search screen on result list and the detail screen.";
LocaleInfo.generic_editor_PropertyEditor_customStyleDescriptionKeyScriptHint = "<p>I will specify the style for the input element of the search screen of condition parts and the output element of the search screen on result list and the detail screen.</p><br/><br/><p>Base Variable</p><ul><li>out : Writer</li><li>em : EntityManager</li><li>edm : EntityDefinitionManager</li><li>auth : AuthContext</li></ul><p>Specific Variable</p><ul><li>today : Current date. Instance of java.sql.Timestamp.</li><li>entity : Target entity data.<br/>When DetailLayout(insert mode), [entity] is null.</li><li>value : Target property data.<br/>When DetailLayout(insert mode), [value] is null.</li></ul>";
LocaleInfo.generic_editor_PropertyEditor_inputCustomStyleDisplayNameKey = "Input Custom Style";
