LocaleInfo.generic_element_section_MassReferenceSection_filterConditionScriptDisplaNameKey = "Search default condition";
LocaleInfo.generic_element_section_MassReferenceSection_filterConditionScriptDescriptionKey = "It is PreparedQuery to specify the conditions to narrow automatically to the reference data when searching.<br />Specify the conditions specified in the WHERE clause.<br /><br />The following is bound.<br /><div style=\"width:99%; height:220px; overflow: auto; border:1px solid #000000;\"><h4>Custom Binding</h4><ul style=\"padding-left: 20px;\"><li>request : Request</li><li>session : Session</li></ul><h4>PreparedQuery Binding</h4><ul style=\"padding-left: 20px;\"><li>user : Information of the user running *1 Refer</li><li>date : Instance of java.util.Date of the current date and time.</li><li>sysdate : String (not including time) current date. ex:2011-01-20</li><li>sysdatetime : String of the current date and time. ex:2011-01-18 02:05:03.348</li><li>systime : String of current time. ex: 23:19:00</li><li>toIn(Collection/Array): Convert string representation of the argument in. <br/>Use cases: oid in (${toIn(user.groupOid)})</li><li>toDateString(Date): Convert a string representation of the date argument.<br/>Use cases: startDate > '${toDateString(date)}'</li><li>toLocalDateString(Date): Convert string representation of local date argument.<br/>Use cases: startDate > '${toLocalDateString(date)}'</li><li>toDateTimeString(Date): Converted to a string representation of the date and time the argument.<br/>Use cases: startDateTime > '${toDateTimeString(date)}'</li><li>toTimeString(Date): Convert string representation of the time argument.<br/>Use cases: startTime > '${toTimeString(date)}'</li><li>toLocalTimeString(Date): Convert string representation of local time arguments.<br/>Use cases: startTime > '${toLocalTimeString(date)}'</li><li>addYear(Date, int): Get the java.util.Date instance the addition of the year specified in the argument.<br/>Use cases: startDate > '${toDateString(addYear(date, -1))}'</li><li>addMonth(Date, int): Get the java.util.Date instance the addition of the month specified in the argument.<br/>Use cases: startDate > '${toDateString(addMonth(date, 3))}'</li><li>addWeek(Date, int): Get the java.util.Date instance the addition of the week specified in the argument.<br/>Use cases: startDate > '${toDateString(addWeek(date, -2))}'</li><li>addDay(Date, int): Get the java.util.Date instance the addition of the day specified in the argument.<br/>Use cases: startDate > '${toDateString(addDay(date, 10))}'</li><li>addHour(Date, int): Get the java.util.Date instance the addition of the hour specified in the argument.<br/>Use cases: startDateTime > '${toDateTimeString(addHour(date, -12))}'</li><li>addMinute(Date, int): Get the java.util.Date instance the addition of the minute specified in the argument.<br/>Use cases: startTime > '${toTimeString(addMinute(date, 30))}'</li><li>addSecond(Date, int): Get the java.util.Date instance the addition of the second specified in the argument.<br/>Use cases: startTime > '${toTimeString(addSecond(date, -10))}'</li><li>addMillisecond(Date, int): Get the java.util.Date instance the addition of the millisecond specified in the argument.<br/>Use cases: startDateTime > '${toDateTimeString(addMillisecond(date, -500))}'</li></ul><h4>GroovyTemplate Binding</h4><ul style=\"padding-left: 20px;\"><li>out : Writer</li><li>em : EntityManager</li><li>edm : EntityDefinitionManager</li><li>auth : AuthContext</li><li>escHtml(Object) : Escape the argument for Html</li><li>escJs(Object) : The Javascript escape the argument</li><li>escSql(Object) : The SQL escape the argument</li><li>escSqlLike(Object) : Like for the SQL escape the argument</li><li>nte(Object) : The argument is converted to an empty case of null</li></ul><h4>*1 about user</h4>You can call functions and variables the following for the group that user belongs<ul style=\"padding-left: 20px;\"><li>groupCode : String[] of group code of group membership.</li><li>groupCodeWithChildren : String[] of group code (including subordinate groups) group membership.</li><li>groupCodeWithParents : String[] of group code (upper group to (root) including) group membership.</li><li>groupOid : Oid String[] of group membership.</li><li>groupOidWithChildren : String[] oid of the group (including subordinate groups) group membership.</li><li>groupOidWithParents : String[] oid of the group (upper group to (root) including) group membership.</li><li>memberOf(String): Returns the true if (even if you belong to the sub-group) members of the group code of the argument.</li></ul></div><br />Setting example:<div style=\"width:99%; height:140px; overflow: auto; border:1px solid #000000;\">&lt;%@import java.sql.Timestamp%&gt;<br />&lt;%@import java.text.SimpleDateFormat %&gt;<br />&lt;%<br />def date = new SimpleDateFormat(\"yyyy/MM/dd\").parse(\"2012/09/06\");<br />def timestamp = new Timestamp(date.getTime());<br />%&gt;<br />createDate&lt;='${timestamp}' and createBy='${user.getAttribute(\"oid\")}'</pre></div>";
