LocaleInfo.generic_element_section_SearchConditionSection_csvdownloadFileNameScriptDisplaNameKey = "CSV file name format";
LocaleInfo.generic_element_section_SearchConditionSection_csvdownloadFileNameScriptDescriptionKey = "<p>Base Variable</p><ul><li>out : Writer</li><li>em : EntityManager</li><li>edm : EntityDefinitionManager</li><li>auth : AuthContext</li><li>user : User information. </br>Can specify the properties of the User entity as ${user.xxxx}.</li></ul><p>Date Variable</p><ul><li>date : Instance of java.sql.Timestamp</li><li>yyyy : Year</li><li>MM : Month</li><li>dd : Day</li><li>HH : Hour, 24 hour notation</li><li>mm : Minute</li><li>ss : Second</li></ul><p>Specific Variable</p><ul><li>csvName : default csv file name.(= ${entityDisplayName})</li><li>entityName : entity name.</li><li>entityDisplayName : entity display name</li><li>viewName : entity view name.<br/>When view is default, [viewName] is null.</li></ul><br/><p>Example</p><li>${csvName}_${yyyy}${MM}${dd}${HH}${mm}${ss}</li>";
LocaleInfo.generic_element_section_SearchConditionSection_defaultConditionDisplaNameKey = "Search default condition";
LocaleInfo.generic_element_section_SearchConditionSection_defaultConditionDescriptionKey = "Specify the search conditions that are not displayed on the search screen and are automatically assigned at the time of search in the PreparedQuery format. Specify the conditions specified in the WHERE clause.<br /><br />The following is bound.<br /><div style=\"width:99%; height:220px; overflow: auto; border:1px solid #000000;\"><h4>Custom Binding</h4><ul style=\"padding-left: 20px;\"><li>request : Request</li><li>session : Session</li></ul><h4>PreparedQuery Binding</h4><ul style=\"padding-left: 20px;\"><li>user : Information of the user running *1 Refer</li><li>date : Instance of java.util.Date of the current date and time.</li><li>sysdate : String (not including time) current date. ex:2011-01-20</li><li>sysdatetime : String of the current date and time. ex:2011-01-18 02:05:03.348</li><li>systime : String of current time. ex: 23:19:00</li><li>toIn(Collection/Array): Convert string representation of the argument in. <br/>Use cases: oid in (${toIn(user.groupOid)})</li><li>toDateString(Date): Convert a string representation of the date argument.<br/>Use cases: startDate > '${toDateString(date)}'</li><li>toLocalDateString(Date): Convert string representation of local date argument.<br/>Use cases: startDate > '${toLocalDateString(date)}'</li><li>toDateTimeString(Date): Converted to a string representation of the date and time the argument.<br/>Use cases: startDateTime > '${toDateTimeString(date)}'</li><li>toTimeString(Date): Convert string representation of the time argument.<br/>Use cases: startTime > '${toTimeString(date)}'</li><li>toLocalTimeString(Date): Convert string representation of local time arguments.<br/>Use cases: startTime > '${toLocalTimeString(date)}'</li><li>addYear(Date, int): Get the java.util.Date instance the addition of the year specified in the argument.<br/>Use cases: startDate > '${toDateString(addYear(date, -1))}'</li><li>addMonth(Date, int): Get the java.util.Date instance the addition of the month specified in the argument.<br/>Use cases: startDate > '${toDateString(addMonth(date, 3))}'</li><li>addWeek(Date, int): Get the java.util.Date instance the addition of the week specified in the argument.<br/>Use cases: startDate > '${toDateString(addWeek(date, -2))}'</li><li>addDay(Date, int): Get the java.util.Date instance the addition of the day specified in the argument.<br/>Use cases: startDate > '${toDateString(addDay(date, 10))}'</li><li>addHour(Date, int): Get the java.util.Date instance the addition of the hour specified in the argument.<br/>Use cases: startDateTime > '${toDateTimeString(addHour(date, -12))}'</li><li>addMinute(Date, int): Get the java.util.Date instance the addition of the minute specified in the argument.<br/>Use cases: startTime > '${toTimeString(addMinute(date, 30))}'</li><li>addSecond(Date, int): Get the java.util.Date instance the addition of the second specified in the argument.<br/>Use cases: startTime > '${toTimeString(addSecond(date, -10))}'</li><li>addMillisecond(Date, int): Get the java.util.Date instance the addition of the millisecond specified in the argument.<br/>Use cases: startDateTime > '${toDateTimeString(addMillisecond(date, -500))}'</li></ul><h4>GroovyTemplate Binding</h4><ul style=\"padding-left: 20px;\"><li>out : Writer</li><li>em : EntityManager</li><li>edm : EntityDefinitionManager</li><li>auth : AuthContext</li><li>escHtml(Object) : Escape the argument for Html</li><li>escJs(Object) : The Javascript escape the argument</li><li>escSql(Object) : The SQL escape the argument</li><li>escSqlLike(Object) : Like for the SQL escape the argument</li><li>nte(Object) : The argument is converted to an empty case of null</li></ul><h4>*1 about user</h4>You can call functions and variables the following for the group that user belongs<ul style=\"padding-left: 20px;\"><li>groupCode : String[] of group code of group membership.</li><li>groupCodeWithChildren : String[] of group code (including subordinate groups) group membership.</li><li>groupCodeWithParents : String[] of group code (upper group to (root) including) group membership.</li><li>groupOid : Oid String[] of group membership.</li><li>groupOidWithChildren : String[] oid of the group (including subordinate groups) group membership.</li><li>groupOidWithParents : String[] oid of the group (upper group to (root) including) group membership.</li><li>memberOf(String): Returns the true if (even if you belong to the sub-group) members of the group code of the argument.</li></ul></div><br />Setting example:<div style=\"width:99%; height:140px; overflow: auto; border:1px solid #000000;\">&lt;%@import java.sql.Timestamp%&gt;<br />&lt;%@import java.text.SimpleDateFormat %&gt;<br />&lt;%<br />def date = new SimpleDateFormat(\"yyyy/MM/dd\").parse(\"2012/09/06\");<br />def timestamp = new Timestamp(date.getTime());<br />%&gt;<br />createDate&lt;='${timestamp}' and createBy='${user.getAttribute(\"oid\")}'</pre></div>";
