LocaleInfo.generic_element_section_SearchConditionSection_defaultPropertyConditionScriptDisplaNameKey = "Default property condition setting script";
LocaleInfo.generic_element_section_SearchConditionSection_defaultPropertyConditionScriptDescriptionKey = "Set GroovyScript to specify the conditions to be set by default to search the initial display screen.<BR />InitCondMap (Map<String,Object>) is bound as a variable.<BR />Value is set as the initial conditions by setting a value in the form of [value to the initial condition: property name (is no sc_), value key] to initCondMap in this script.<BR /><BR/>As a bind variable, [user: User Information], [request: Request information], [session: Session Information] is bound in advance.<BR/>If you have a condition that is specified as [sc_ Property name] in the request parameter, it is set to initCondMap in advance.<BR />Must be set to the OID value in the case of Reference Property.<BR />Please set in the array if you want to set the conditions are in the same property.";
